import "./app.css";
import React, { useEffect, useState } from "react";
import Button from "./button";

function App() {
  const [count, setCount] = useState(0);

  const handleEvent = () => {
    setCount(count + 2);
  };
  return (
    <>
      <Button onClick={handleEvent}></Button>
    </>
  );
}

export default App;
